Quotes_Denied_Toolti_1.query:
q = load "${App.Datasets.Quote_FOR_DEMO1.FullyQualifiedName}";
q = filter q by 'Status' == "Denied";
q = foreach q generate 'Quote_Name' as 'Quote_Name', 'Quote_Margin_Total' as 'Quote_Margin_Total', 'Effective_Quote_Total' as 'Effective_Quote_Total';
q = order q by 'Quote_Margin_Total' desc;
q = limit q 100;
